import React from 'react';
import { useParams } from 'react-router-dom';
import { Row, Col, Card } from 'antd';
import { Link } from 'react-router-dom';

const CityProperties = ({ properties }) => {
  const { city } = useParams();
  const filteredProperties = properties.filter(property => property.il === city);

  return (
    <div style={{ padding: '50px' }}>
      <h2>{city} Åžehrindeki Emlaklar</h2>
      <Row gutter={[16, 16]}>
        {filteredProperties.map(property => (
          <Col span={8} key={property.id}>
            <Link to={`/property-detail/${property.id}`}>
              <Card
                hoverable
                cover={<img alt={property.ilanbaslik} src={property.photos[0]?.url} />}
              >
                <Card.Meta title={property.ilanbaslik} description={`${property.fiyat} TL`} />
              </Card>
            </Link>
          </Col>
        ))}
      </Row>
    </div>
  );
};

export default CityProperties;
